export default function todoToShowReducer(state = null, action) {
  let todoToShow;   
  switch (action.type) {
          case 'GET_TODO':
            console.log(action.todoToShow)
            todoToShow = {
              id: action.todoToShow.id,
              title: action.todoToShow.title,
              content: action.todoToShow.content
            }
            return todoToShow
          default:
            return state
      }
    }
